import { Component } from "react";

export default class NewPlan extends Component {
  render() {
    return (
      <div>
        <h1>Creat Plan</h1>
        <label>Start Date:</label>
        <input type="date" />
        <label>End Date</label>
        <input type="date" />
      </div>
    );
  }
}
